"Google Photos геодеректі пайдаланып, фотосуреттеріңізді жинауға және іздеуге көмектеседі.

 Локация біренеше дереккөздерден алынады. Мысалы:
 • Камераңыздың GPS модулі;
 • Локация тарихы жазылатын Google құрылғысының қызметі;
 • Анықталған көрнекі белгілер."

"Геодерегі бар суреттерді, оның ішінде сақтап қойған бөлісілген суреттерді қарап, болған жерлеріңізді еске алыңыз. Карта төмендегідей геодеректі пайдаланады:

 • камераның GPS координатасы;
 • Google локация тарихы;
 • анықталған көрнекті белгілер."

"Геодерегі бар суреттерді, оның ішінде өзіңіз бөліскен суреттердің ішіндегі сақтап қойғандарыңызды қарап, болған жерлеріңізді еске алыңыз. Картаңыз төмендегідей геодеректі пайдаланады:

 • камераңыздың GPS координатасы;
 • анықталған көрнекті белгілер."

"Google Photos келесі қолданба деректерін құрылғыңыздан мүлдем жояды: 

• Құлыпталған қалтадағы суреттер мен бейнелер; 
• жүйеге кірген аккаунттар; 
• параметрлер. 

Құлыпталған қалтадан тыс суреттер мен бейнелер, басқа қолданба деректері жойылмайды."
